std::bind_front() is a wrapper of a specific form of lambda expression - https://en.cppreference.com/w/cpp/utility/functional/bind_front

`std::bind_front(f, bound_args...)(call_args...)` is equivalent to `std::invoke(f, bound_args..., call_args...)`.

So, 

```
    getLedGroupService(asyncResp, subtreePaths[0],
                       [callback, subtreePaths](const std::string& service) {
        callback(subtreePaths[0], service);
    });

```

will be written as

```
    getLedGroupService(asyncResp, subtreePaths[0], std::bind_front(callback, subtreePaths[0]));

```

