@ed you are right, this change breaks the previously working systems.

Previously, the LED group path ("/xyz/openbmc_project/led/groups/enclosure_identify_blink") and LED group service ("xyz.openbmc_project.LED.GroupManager") were hard-coded in the code.

In this commit, the code dynamically retrieves the LED group path and service from the "identifying" association. The "LocationIndicatorActive" property is newly introduced for power supplies and fans, and for these components, we should retrieve this information from the "identifying" association.

To resolve this issue, one approach is keep the current code as is for systems and chassis, and use the new approach for PowerSupply and Fans.
